import React, { useRef, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Login.css";

export default function SignupPage() {
    const [errorMessage, setErrorMessage] = useState("");
    const fullNameRef = useRef();
    const emailRef = useRef();
    const passwordRef = useRef();
    const mobileRef = useRef();
    const dateRef = useRef();
    const confirmPasswordRef = useRef();
    const navigate = useNavigate();

    const handleSignupSuccess = (event) => {
        event.preventDefault();
        setErrorMessage(""); 

        const fullName = fullNameRef.current.value.trim();
        const email = emailRef.current.value.trim();
        const mobile = mobileRef.current.value.trim();
        const date = dateRef.current.value.trim();
        const password = passwordRef.current.value.trim();
        const confirmPassword = confirmPasswordRef.current.value.trim();

       
        if (!fullName || !email || !mobile || !date || !password || !confirmPassword) {
            setErrorMessage("All fields are required!");
            return;
        }
        if (!/^[a-zA-Z]([a-zA-Z]+)?[a-zA-Z]$/.test(fullName)) {
            setErrorMessage("Enter Valid name!");
            return;
        }
        if (!/^[6-9][0-9]{9}$/.test(mobile)) {
            setErrorMessage("Enter Valid mobile number!");
            return;
        }
        if (!/^([a-zA-Z0-9]+)@([a-zA-Z0-9]+)\.([a-zA-Z]{2,})(\.[a-zA-Z]{2,})?$/.test(email)) {
            setErrorMessage("Enter Valid email!");
            return;
        }
        if (!/^(?=.*[0-9])(?=.*[a-z])(?=.*[A-Z])(?=.*[@#\$]).{6,12}$/.test(password)) {
            setErrorMessage("Password must be 6-12 characters, with at least one digit, one lowercase letter, one uppercase letter, and one special character (@, #, $)");
            return;
        }

        if (password !== confirmPassword) {
            setErrorMessage("Passwords do not match!");
            return;
        }

        console.log("Full Name:", fullName);
        console.log("Email:", email);
        console.log("Mobile:", mobile);
        console.log("Date of Birth:", date);
        console.log("Password:", password);

        
        navigate("/logins");
    };

    return (
        <div className="unique-login-page">
            <div className="unique-login-container">
                <div className="unique-form-container">
                    <h2 className="unique-form-title">Sign Up</h2>
                    <form
                        className="unique-form unique-signup-form"
                        onSubmit={handleSignupSuccess}
                    >
                        {errorMessage && (
                            <p className="error-message">{errorMessage}</p>
                        )}
                        <div className="unique-form-group">
                            <label htmlFor="fullname">Full Name</label>
                            <input
                                className="unique-form-input"
                                type="text"
                                id="fullname"
                                placeholder="Enter your full name"
                                ref={fullNameRef}
                                required
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="email">Email</label>
                            <input
                                className="unique-form-input"
                                type="email"
                                id="email"
                                placeholder="Enter your email"
                                ref={emailRef}
                                required
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="mobile">Mobile No</label>
                            <input
                                className="unique-form-input"
                                type="tel"
                                id="mobile"
                                placeholder="Enter your mobile number"
                                ref={mobileRef}
                                required
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="date">Date of Birth</label>
                            <input
                                className="unique-form-input"
                                type="date"
                                id="date"
                                ref={dateRef}
                                required
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="password">Password</label>
                            <input
                                className="unique-form-input"
                                type="password"
                                id="password"
                                placeholder="Create a password"
                                ref={passwordRef}
                                required
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="confirmpassword">Confirm Password</label>
                            <input
                                className="unique-form-input"
                                type="password"
                                id="confirmpassword"
                                placeholder="Confirm your password"
                                ref={confirmPasswordRef}
                                required
                            />
                        </div>
                        <button
                            type="submit"
                            className="unique-form-submit-button"
                        >
                            Sign Up
                        </button>
                    </form>
                    <div className="unique-login-link">
                        <p>
                            Already have an account? <Link to="/logins">Sign In</Link>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
}
